import React from 'react';


function App() {
  return (
    <div className="App container">
      <table>
          <thead>
            <tr>
                <th>ID</th>
                <th>Title</th>
                <th>Rating</th>
                <th></th>
            </tr>
          </thead>
      </table>
    </div>
  );
}

export default App;
